-- Name: audit_wallet_security(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.audit_wallet_security() RETURNS TABLE(issue_type character varying, order_id integer, customer_id integer, description text, severity character varying, affected_amount numeric)
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- مشکل 1: تراکنش‌هایی با customer_id متفاوت در یک reference_id
    RETURN QUERY
    SELECT 
        'CUSTOMER_ID_MISMATCH'::VARCHAR as issue_type,
        wt.reference_id as order_id,
        wt.customer_id,
        'تراکنش‌هایی با customer_id متفاوت در یک سفارش یافت شد'::TEXT as description,
        'CRITICAL'::VARCHAR as severity,
        SUM(wt.amount) as affected_amount
    FROM wallet_transactions wt
    WHERE wt.reference_id IN (
        SELECT wt2.reference_id 
        FROM wallet_transactions wt2
        WHERE wt2.reference_id IS NOT NULL
        GROUP BY wt2.reference_id 
        HAVING COUNT(DISTINCT wt2.customer_id) > 1
    )
    GROUP BY wt.reference_id, wt.customer_id;
    
    -- مشکل 2: عدم تطبیق customer_id بین سفارش و تراکنش
    RETURN QUERY
    SELECT 
        'ORDER_CUSTOMER_MISMATCH'::VARCHAR,
        co.id,
        wt.customer_id,
        'customer_id سفارش (' || co.customer_id || ') با customer_id تراکنش (' || wt.customer_id || ') تطبیق ندارد'::TEXT,
        'CRITICAL'::VARCHAR,
        wt.amount
    FROM wallet_transactions wt
    JOIN customer_orders co ON wt.reference_id = co.id
    WHERE wt.customer_id != co.customer_id
      AND wt.reference_type NOT IN ('system_correction');
    
    -- مشکل 3: مبالغ غیرعادی (بیش از 10 میلیون دینار)
    RETURN QUERY
    SELECT 
        'UNUSUAL_AMOUNT'::VARCHAR,
        wt.reference_id,
        wt.customer_id,
        'مبلغ غیرعادی: ' || wt.amount || ' - ' || wt.description::TEXT,
        'MEDIUM'::VARCHAR,
        wt.amount
    FROM wallet_transactions wt
    WHERE wt.amount > 10000000
      AND wt.created_at >= CURRENT_DATE - INTERVAL '7 days';
    
    -- مشکل 4: تراکنش‌های مشکوک بدون reference_id مناسب
    RETURN QUERY
    SELECT 
        'MISSING_REFERENCE'::VARCHAR,
        NULL::INTEGER,
        wt.customer_id,
        'تراکنش بدون reference_id مناسب - ' || wt.description::TEXT,
        'HIGH'::VARCHAR,
        wt.amount
    FROM wallet_transactions wt
    WHERE wt.reference_id IS NULL 
      AND wt.reference_type NOT IN ('recharge_request', 'system_correction', 'order_adjustment')
      AND wt.created_at >= CURRENT_DATE - INTERVAL '30 days';
    
END;
$$;


--
-- Name: correct_order_payments(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.correct_order_payments() RETURNS TABLE(order_num character varying, cust_id integer, correction_type character varying, amount_corrected numeric, action_taken character varying)
    LANGUAGE plpgsql
    AS $$
DECLARE
    order_record RECORD;
    actual_wallet_payment DECIMAL;
    actual_bank_payment DECIMAL;
    total_paid DECIMAL;
    correction_amount DECIMAL;
    cust_wallet_id INTEGER;
BEGIN
    -- پردازش همه سفارشات تایید شده که نیاز به تصحیح دارند
    FOR order_record IN 
        SELECT co.id, co.order_number, co.customer_id, co.total_amount,
               om.id as management_id, om.wallet_amount_used, om.bank_amount_paid, 
               om.excess_amount_credited, om.current_status
        FROM customer_orders co
        JOIN order_management om ON co.id = om.customer_order_id
        WHERE om.current_status IN ('financial_approved', 'warehouse_pending', 'warehouse_processing', 'warehouse_approved')
          AND COALESCE(om.excess_amount_credited, 0) = 0
    LOOP
        -- محاسبه مبلغ واقعی پرداخت شده از کیف پول
        SELECT COALESCE(SUM(wt.amount), 0) INTO actual_wallet_payment
        FROM wallet_transactions wt
        WHERE wt.reference_id = order_record.id 
          AND wt.reference_type = 'payment_completion' 
          AND wt.transaction_type = 'debit';
        
        -- فرض می‌کنیم bank_amount_paid از order_management صحیح است
        actual_bank_payment := COALESCE(order_record.bank_amount_paid, 0);
        
        -- مجموع پرداخت شده
        total_paid := actual_wallet_payment + actual_bank_payment;
        
        -- محاسبه مبلغ تصحیح مورد نیاز  
        correction_amount := total_paid - order_record.total_amount;
        
        -- اگر تفاوت وجود دارد، تصحیح انجام می‌دهیم
        IF correction_amount != 0 THEN
            -- دریافت wallet_id مشتری
            SELECT cw.id INTO cust_wallet_id FROM customer_wallets cw WHERE cw.customer_id = order_record.customer_id;
            
            IF correction_amount > 0 THEN
                -- اضافه پرداخت - برگشت به کیف پول
                    wallet_id, customer_id, transaction_type, amount, currency,
                    balance_before, balance_after, description, reference_type, reference_id,
                    status, processed_by, notes, created_at, updated_at
                )
                SELECT 
                    cust_wallet_id, order_record.customer_id, 'credit', correction_amount, 'IQD',
                    cw.balance, cw.balance + correction_amount,
                    'برگشت اضافه پرداخت سفارش ' || order_record.order_number || ' - تصحیح خودکار سیستم',
                    'order_adjustment', order_record.id,
                    'completed', 1,
                    'مبلغ پرداخت شده: ' || total_paid || ' - مبلغ سفارش: ' || order_record.total_amount || ' = اضافه ' || correction_amount,
                    NOW(), NOW()
                FROM customer_wallets cw WHERE cw.customer_id = order_record.customer_id;
                
                -- بروزرسانی موجودی کیف پول
                UPDATE customer_wallets 
                SET balance = balance + correction_amount, last_activity_date = NOW(), updated_at = NOW()
                WHERE customer_wallets.customer_id = order_record.customer_id;
                
                order_num := order_record.order_number;
                cust_id := order_record.customer_id;
                correction_type := 'اضافه پرداخت';
                amount_corrected := correction_amount;
                action_taken := 'برگشت به کیف پول';
                
            ELSE 
                -- کسری پرداخت - کسر از کیف پول
                    wallet_id, customer_id, transaction_type, amount, currency,
                    balance_before, balance_after, description, reference_type, reference_id,
                    status, processed_by, notes, created_at, updated_at
                )
                SELECT 
                    cust_wallet_id, order_record.customer_id, 'debit', ABS(correction_amount), 'IQD',
                    cw.balance, cw.balance - ABS(correction_amount),
                    'تکمیل پرداخت سفارش ' || order_record.order_number || ' - تصحیح خودکار سیستم',
                    'order_adjustment', order_record.id,
                    'completed', 1,
                    'مبلغ پرداخت شده: ' || total_paid || ' - مبلغ سفارش: ' || order_record.total_amount || ' = کسری ' || ABS(correction_amount),
                    NOW(), NOW()
                FROM customer_wallets cw WHERE cw.customer_id = order_record.customer_id;
                
                -- بروزرسانی موجودی کیف پول
                UPDATE customer_wallets 
                SET balance = balance - ABS(correction_amount), last_activity_date = NOW(), updated_at = NOW()
                WHERE customer_wallets.customer_id = order_record.customer_id;
                
                order_num := order_record.order_number;
                cust_id := order_record.customer_id;
                correction_type := 'کسری پرداخت';
                amount_corrected := ABS(correction_amount);
                action_taken := 'کسر از کیف پول';
            END IF;
            
            -- بروزرسانی order_management
            UPDATE order_management 
            SET 
                wallet_amount_used = actual_wallet_payment,
                bank_amount_paid = actual_bank_payment,
                excess_amount_credited = correction_amount,
                financial_notes = CONCAT(
                    COALESCE(financial_notes, ''), 
                    ' | تصحیح خودکار: ', correction_type, ' ', ABS(correction_amount), ' دینار - ', NOW()
                )
            WHERE id = order_record.management_id;
            
            RETURN NEXT;
        END IF;
    END LOOP;
END;
$$;


--
-- Name: find_order_info_by_number(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.find_order_info_by_number(p_order_number character varying) RETURNS TABLE(order_id integer, customer_id integer, customer_name text, order_total numeric, wallet_balance numeric, order_status text)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        co.id as order_id,
        co.customer_id,
        CONCAT(cc.first_name, ' ', cc.last_name) as customer_name,
        co.total_amount as order_total,
        cw.balance as wallet_balance,
        co.status::TEXT as order_status
    FROM customer_orders co
    JOIN crm_customers cc ON co.customer_id = cc.id
    JOIN customer_wallets cw ON co.customer_id = cw.customer_id
    WHERE co.order_number = p_order_number;
END;
$$;


--
-- Name: manage_wallet_payment_by_order_number(character varying, numeric, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.manage_wallet_payment_by_order_number(p_order_number character varying, p_correction_amount numeric, p_description text DEFAULT NULL::text) RETURNS json
    LANGUAGE plpgsql
    AS $_$
DECLARE
    v_result JSON;
    v_order_info RECORD;
    v_wallet_id INTEGER;
    v_current_balance DECIMAL;
    v_transaction_id INTEGER;
    v_correction_type VARCHAR;
    v_final_description TEXT;
BEGIN
    -- تشخیص نوع تصحیح
    IF p_correction_amount > 0 THEN
        v_correction_type := 'overpayment_credit';
    ELSE
        v_correction_type := 'underpayment_debit';
    END IF;
    
    -- گام 1: یافتن اطلاعات سفارش و کیف پول مشتری
    SELECT 
        co.id as order_id,
        co.customer_id,
        co.order_number,
        co.total_amount,
        cw.id as wallet_id,
        cw.balance,
        CONCAT(cc.first_name, ' ', cc.last_name) as customer_name
    INTO v_order_info
    FROM customer_orders co
    JOIN customer_wallets cw ON co.customer_id = cw.customer_id
    JOIN crm_customers cc ON co.customer_id = cc.id
    WHERE co.order_number = p_order_number;
    
    -- بررسی وجود سفارش
    IF NOT FOUND THEN
        RETURN json_build_object(
            'success', false,
            'error', 'سفارش با شماره ' || p_order_number || ' یافت نشد',
            'error_code', 'ORDER_NOT_FOUND'
        );
    END IF;
    
    -- بررسی الگوی شماره سفارش
    IF v_order_info.order_number !~ '^M25[0-9]{5}$' THEN
        RETURN json_build_object(
            'success', false,
            'error', 'شماره سفارش باید الگوی M2511111 را رعایت کند',
            'error_code', 'INVALID_ORDER_PATTERN',
            'provided_pattern', v_order_info.order_number
        );
    END IF;
    
    -- بررسی معقول بودن مبلغ
    IF ABS(p_correction_amount) > v_order_info.total_amount * 3 THEN
        RETURN json_build_object(
            'success', false,
            'error', 'مبلغ تصحیح غیرمعقول: بیش از سه برابر مبلغ سفارش',
            'error_code', 'UNREASONABLE_AMOUNT',
            'order_amount', v_order_info.total_amount,
            'correction_amount', ABS(p_correction_amount)
        );
    END IF;
    
    -- بررسی موجودی کافی برای کسری (مبالغ منفی)
    IF p_correction_amount < 0 AND v_order_info.balance < ABS(p_correction_amount) THEN
        RETURN json_build_object(
            'success', false,
            'error', 'موجودی کیف پول ناکافی برای کسری واریزی',
            'error_code', 'INSUFFICIENT_BALANCE',
            'current_balance', v_order_info.balance,
            'required_amount', ABS(p_correction_amount)
        );
    END IF;
    
    -- تولید توضیحات نهایی
    v_final_description := CASE 
        WHEN p_correction_amount > 0 THEN 
            'اضافه واریزی سفارش ' || p_order_number || ' - مبلغ: ' || ABS(p_correction_amount) || ' دینار'
        ELSE
            'کسری واریزی سفارش ' || p_order_number || ' - مبلغ: ' || ABS(p_correction_amount) || ' دینار'
    END;
    
    IF p_description IS NOT NULL THEN
        v_final_description := v_final_description || ' - ' || p_description;
    END IF;
    
    -- شروع تراکنش اتمی
    BEGIN
        -- گام 2: ثبت تراکنش کیف پول
            wallet_id, customer_id, transaction_type, amount, currency,
            balance_before, balance_after, description, reference_type, reference_id,
            status, processed_by, notes, created_at, updated_at
        ) VALUES (
            v_order_info.wallet_id,
            v_order_info.customer_id,
            CASE WHEN p_correction_amount > 0 THEN 'credit' ELSE 'debit' END,
            ABS(p_correction_amount),
            'IQD',
            v_order_info.balance,
            v_order_info.balance + p_correction_amount,
            v_final_description,
            'order_payment_correction',
            v_order_info.order_id,
            'completed',
            1,
            'تصحیح امن براساس شماره سفارش - Customer: ' || v_order_info.customer_id || 
            ' - Order: ' || p_order_number || ' - Type: ' || v_correction_type,
            NOW(),
            NOW()
        ) RETURNING id INTO v_transaction_id;
        
        -- گام 3: بروزرسانی موجودی کیف پول
        UPDATE customer_wallets 
        SET balance = balance + p_correction_amount,
            last_activity_date = NOW(),
            updated_at = NOW()
        WHERE customer_id = v_order_info.customer_id;
        
        -- گام 4: بروزرسانی اطلاعات سفارش در order_management
        UPDATE order_management 
        SET excess_amount_credited = CASE 
                WHEN p_correction_amount > 0 THEN 
                    COALESCE(excess_amount_credited, 0) + ABS(p_correction_amount)
                ELSE 
                    COALESCE(excess_amount_credited, 0) - ABS(p_correction_amount)
            END,
            financial_notes = CONCAT(
                COALESCE(financial_notes, ''), 
                ' | ', v_final_description, ' - تراکنش ', v_transaction_id, ' - ', NOW()
            ),
            updated_at = NOW()
        WHERE customer_order_id = v_order_info.order_id;
        
        -- بازگشت نتیجه موفق
        RETURN json_build_object(
            'success', true,
            'transaction_id', v_transaction_id,
            'order_number', p_order_number,
            'customer_id', v_order_info.customer_id,
            'customer_name', v_order_info.customer_name,
            'correction_type', v_correction_type,
            'amount', ABS(p_correction_amount),
            'old_balance', v_order_info.balance,
            'new_balance', v_order_info.balance + p_correction_amount,
            'description', v_final_description
        );
        
    EXCEPTION WHEN OTHERS THEN
        -- در صورت خطا، rollback خودکار انجام می‌شود
        RETURN json_build_object(
            'success', false,
            'error', 'خطا در انجام تراکنش: ' || SQLERRM,
            'error_code', 'TRANSACTION_FAILED'
        );
    END;
END;
$_$;


--
-- Name: prevent_orphaned_management(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.prevent_orphaned_management() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
        BEGIN
          -- اگر customer_order حذف شد، order_management هم حذف شود
          DELETE FROM order_management WHERE customer_order_id = OLD.id;
          RETURN OLD;
        END;
        $$;


--
-- Name: secure_payment_correction(integer, integer, numeric, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.secure_payment_correction(p_order_id integer, p_expected_customer_id integer, p_correction_amount numeric, p_correction_type character varying) RETURNS json
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_result JSON;
    v_customer_verification RECORD;
    v_wallet_id INTEGER;
    v_current_balance DECIMAL;
    v_transaction_id INTEGER;
    v_order_number VARCHAR;
BEGIN
    -- گام 1: تأیید چهارگانه مالکیت و اعتبار
    SELECT 
        cw.id as wallet_id,
        cw.customer_id,
        cw.balance,
        co.order_number,
        co.total_amount,
        CASE WHEN cw.customer_id = co.customer_id AND co.customer_id = p_expected_customer_id 
             THEN TRUE ELSE FALSE END as ownership_verified
    INTO v_customer_verification
    FROM customer_wallets cw
    JOIN customer_orders co ON cw.customer_id = co.customer_id
    WHERE co.id = p_order_id 
      AND cw.customer_id = p_expected_customer_id;
    
    -- بررسی وجود رکورد
    IF NOT FOUND THEN
        RETURN json_build_object(
            'success', false,
            'error', 'سفارش یا مشتری یافت نشد',
            'error_code', 'NOT_FOUND'
        );
    END IF;
    
    -- بررسی تطبیق مالکیت
    IF NOT v_customer_verification.ownership_verified THEN
        RETURN json_build_object(
            'success', false,
            'error', 'عدم تطبیق مالکیت: مشتری سفارش با مشتری کیف پول یکسان نیست',
            'error_code', 'OWNERSHIP_MISMATCH',
            'details', json_build_object(
                'order_id', p_order_id,
                'expected_customer', p_expected_customer_id,
                'actual_customer', v_customer_verification.customer_id
            )
        );
    END IF;
    
    -- گام 2: بررسی معقول بودن مبلغ
    IF ABS(p_correction_amount) > v_customer_verification.total_amount * 2 THEN
        RETURN json_build_object(
            'success', false,
            'error', 'مبلغ تصحیح غیرمعقول: بیش از دو برابر مبلغ سفارش',
            'error_code', 'UNREASONABLE_AMOUNT'
        );
    END IF;
    
    -- گام 3: بررسی موجودی کافی برای debit
    IF p_correction_type = 'underpayment' AND v_customer_verification.balance < p_correction_amount THEN
        RETURN json_build_object(
            'success', false,
            'error', 'موجودی کیف پول ناکافی',
            'error_code', 'INSUFFICIENT_BALANCE',
            'current_balance', v_customer_verification.balance,
            'required_amount', p_correction_amount
        );
    END IF;
    
    -- شروع تراکنش اتمی
    BEGIN
        -- گام 4: ثبت تراکنش با کنترل کامل
            wallet_id, customer_id, transaction_type, amount, currency,
            balance_before, balance_after, description, reference_type, reference_id,
            status, processed_by, notes, created_at, updated_at
        ) VALUES (
            v_customer_verification.wallet_id,
            p_expected_customer_id,
            CASE WHEN p_correction_type = 'overpayment' THEN 'credit' ELSE 'debit' END,
            ABS(p_correction_amount),
            'IQD',
            v_customer_verification.balance,
            CASE WHEN p_correction_type = 'overpayment' 
                 THEN v_customer_verification.balance + ABS(p_correction_amount)
                 ELSE v_customer_verification.balance - ABS(p_correction_amount) END,
            CASE WHEN p_correction_type = 'overpayment'
                 THEN 'برگشت اضافه پرداخت سفارش ' || v_customer_verification.order_number || ' - تصحیح امن'
                 ELSE 'تکمیل کسری پرداخت سفارش ' || v_customer_verification.order_number || ' - تصحیح امن' END,
            'secure_correction',
            p_order_id,
            'completed',
            1,
            'تراکنش امن - تأیید چهارگانه انجام شد - Customer: ' || p_expected_customer_id || ' Order: ' || p_order_id,
            NOW(),
            NOW()
        ) RETURNING id INTO v_transaction_id;
        
        -- گام 5: بروزرسانی موجودی کیف پول
        UPDATE customer_wallets 
        SET balance = CASE WHEN p_correction_type = 'overpayment' 
                          THEN balance + ABS(p_correction_amount)
                          ELSE balance - ABS(p_correction_amount) END,
            last_activity_date = NOW(),
            updated_at = NOW()
        WHERE customer_id = p_expected_customer_id;
        
        -- گام 6: بروزرسانی order_management
        UPDATE order_management 
        SET excess_amount_credited = CASE WHEN p_correction_type = 'overpayment' 
                                         THEN ABS(p_correction_amount)
                                         ELSE -ABS(p_correction_amount) END,
            financial_notes = CONCAT(
                COALESCE(financial_notes, ''), 
                ' | تصحیح امن: ', p_correction_type, ' مبلغ ', ABS(p_correction_amount), ' دینار - تراکنش ', v_transaction_id, ' - ', NOW()
            )
        WHERE customer_order_id = p_order_id;
        
        -- بازگشت نتیجه موفق
        RETURN json_build_object(
            'success', true,
            'transaction_id', v_transaction_id,
            'order_number', v_customer_verification.order_number,
            'customer_id', p_expected_customer_id,
            'correction_type', p_correction_type,
            'amount', ABS(p_correction_amount),
            'new_balance', CASE WHEN p_correction_type = 'overpayment' 
                               THEN v_customer_verification.balance + ABS(p_correction_amount)
                               ELSE v_customer_verification.balance - ABS(p_correction_amount) END
        );
        
    EXCEPTION WHEN OTHERS THEN
        -- در صورت خطا، rollback خودکار انجام می‌شود
        RETURN json_build_object(
            'success', false,
            'error', 'خطا در انجام تراکنش: ' || SQLERRM,
            'error_code', 'TRANSACTION_FAILED'
        );
    END;
END;
$$;


--
-- Name: sync_order_management_realtime(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.sync_order_management_realtime() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
        DECLARE
          new_management_status TEXT;
        BEGIN
          -- تعیین وضعیت صحیح order_management بر اساس customer_orders
          IF NEW.status = 'delivered' THEN
            new_management_status := 'delivered';
          ELSIF NEW.status = 'cancelled' OR NEW.status = 'deleted' THEN
            new_management_status := 'cancelled';
          ELSIF NEW.status = 'warehouse_ready' THEN
            new_management_status := 'warehouse_pending';
          ELSIF NEW.status = 'confirmed' OR NEW.status = 'processing' THEN
            new_management_status := 'warehouse_processing';
          ELSIF NEW.status = 'shipped' OR NEW.status = 'in_transit' THEN
            new_management_status := 'in_transit';
          ELSIF NEW.status = 'pending' THEN
            IF NEW.payment_status = 'paid' THEN
              new_management_status := 'warehouse_pending';
            ELSIF NEW.payment_status = 'receipt_uploaded' THEN
              new_management_status := 'pending';
            ELSIF NEW.payment_status = 'rejected' THEN
              new_management_status := 'financial_rejected';
            ELSE
              new_management_status := 'pending';
            END IF;
          ELSE
            new_management_status := 'pending';
          END IF;

          -- بروزرسانی فوری order_management
          UPDATE order_management 
          SET 
            current_status = new_management_status,
            updated_at = NOW(),
            sync_notes = 'Auto-synced via trigger on ' || to_char(NOW(), 'YYYY-MM-DD HH24:MI:SS')
          WHERE customer_order_id = NEW.id;

          -- اگر رکورد وجود نداشت، ایجاد کن
          IF NOT FOUND THEN
              customer_order_id,
              current_status,
              created_at,
              updated_at,
              sync_notes
            ) VALUES (
              NEW.id,
              new_management_status,
              NOW(),
              NOW(),
              'Auto-created via trigger on ' || to_char(NOW(), 'YYYY-MM-DD HH24:MI:SS')
            );
          END IF;

          RETURN NEW;
        END;
        $$;


SET default_tablespace = '';

SET default_table_access_method = heap;

