112	mission_title	ئامانجەکەمان	text	ku	about	t	2025-07-04 12:00:37.001345	2025-07-04 12:00:37.001345
113	mission_text	دابینکردنی چارەسەری کیمیایی نوێ و بەردەوام کە کارایی بەرز دەکاتەوە، کاریگەری ژینگەیی کەم دەکاتەوە و سەرکەوتن بۆ کڕیارەکانمان لە پیشەسازی جیاوازەکان لە سەرانسەری جیهان.	text	ku	about	t	2025-07-04 12:00:37.001345	2025-07-04 12:00:37.001345
114	vision_title	بینینەکەمان	text	ku	about	t	2025-07-04 12:00:37.001345	2025-07-04 12:00:37.001345
115	vision_text	بوون بە دابینکەری سەرەکی چارەسەری کیمیایی لە ڕۆژهەڵاتی ناوین، ناسراو لە جیهاندا بۆ پابەندبوونمان بە کوالیتی، نوێبوون و کردەوە بەردەوامەکان کە سوودی هەردووکی کڕیارەکانمان و ژینگە دەبێت.	text	ku	about	t	2025-07-04 12:00:37.001345	2025-07-04 12:00:37.001345
