1	#01 - Technical Support Response	technical_support	Re: Technical Support Request - {{ticket_number}}	<div style="font-family: Arial, sans-serif; max-width: 600px; margin: 0 auto;">\n<div style="background: linear-gradient(135deg, #059669 0%, #10b981 100%); padding: 20px; border-radius: 8px 8px 0 0;">\n<h1 style="color: white; margin: 0; font-size: 24px;">Technical Support Response</h1>\n</div>\n<div style="background: #f0fdf4; padding: 20px; border-radius: 0 0 8px 8px; border: 1px solid #bbf7d0;">\n<div style="background: white; padding: 20px; border-radius: 6px; margin-bottom: 20px;">\n<h2 style="color: #059669; margin-top: 0;">Dear {{customer_name}},</h2>\n<p>Thank you for contacting our technical support team. We have received your request and assigned ticket number <strong>{{ticket_number}}</strong> to track your case.</p>\n<p><strong>Support Details:</strong></p>\n<ul>\n<li>Ticket Number: {{ticket_number}}</li>\n<li>Priority: {{priority}}</li>\n<li>Support Agent: {{support_agent}}</li>\n<li>Estimated Resolution: {{estimated_resolution}}</li>\n</ul>\n<p>Our technical team is working on your request and will provide you with:</p>\n<ul>\n<li>Detailed analysis of the issue</li>\n<li>Step-by-step solution instructions</li>\n<li>Additional documentation if needed</li>\n<li>Follow-up support if required</li>\n</ul>\n<p>We will keep you updated on the progress and provide a resolution within the estimated timeframe.</p>\n</div>\n<div style="background: white; padding: 20px; border-radius: 6px;">\n<h3 style="color: #059669; margin-top: 0;">Contact Technical Support</h3>\n<p><strong>Momtazchem Technical Team</strong><br/>\nEmail: support@momtazchem.com<br/>\nPhone: +98 21 1234 5678<br/>\nTicket System: Available 24/7</p>\n</div>\n</div>\n</div>	Dear {{customer_name}},\n\nThank you for contacting our technical support team. We have received your request and assigned ticket number {{ticket_number}} to track your case.\n\nSupport Details:\n- Ticket Number: {{ticket_number