xt}}</p>\n        </div>\n        \n        <div style="margin-top: 30px; padding: 20px; background: #e8f4f8; border-radius: 8px;">\n          <h4 style="color: #333; margin-top: 0;">هل تحتاج إلى مساعدة إضافية؟</h4>\n          <p style="color: #666; margin-bottom: 15px;">\n            إذا كان لديك أسئلة إضافية أو تحتاج إلى مزيد من التوضيح، يرجى الاتصال بنا:\n          </p>\n          <p style="color: #444;">\n            <strong>شركة ممتاز الكيميائية</strong><br/>\n            الهاتف: {{contact_phone}}<br/>\n            البريد الإلكتروني: {{contact_email}}<br/>\n            ساعات العمل: السبت - الخميس، 8 صباحاً - 6 مساءً\n          </p>\n        </div>\n      </div>\n    </div>\n    \n    <div style="text-align: center; margin-top: 20px; padding: 15px; background: white; border-radius: 8px;">\n      <p style="color: #888; font-size: 12px; margin: 0;">\n        Thank you for trusting Momtaz Chemical Products | شكراً لثقتكم بمنتجات ممتاز الكيميائية\n      </p>\n    </div>\n  </div>	Dear {{customer_name}} | العزيز {{customer_name}}\n\nThank you for your inquiry. | نشكرك على استفسارك.\n\nYour Inquiry: | استفسارك:\n- Number | الرقم: {{inquiry_number}}\n- Subject | الموضوع: {{subject}}\n- Category | الفئة: {{category}}\n\nOur Response: | ردنا:\n{{response_text}}\n\nFor more help | للمزيد من المساعدة:\nMomtaz Chemical Company | شركة ممتاز الكيميائية\nPhone | الهاتف: {{contact_phone}}\nEmail | البريد: {{contact_email}}\n\nThank you | شكراً،\nMomtaz Team | فريق ممتاز	["customer_name", "inquiry_number", "subject", "category", "response_text", "contact_phone", "contact_email"]	t	f	en_ar	7	0	\N	2025-07-12 07:44:42.894398	2025-07-12 07:44:42.894398
