1	دستورالعمل تولید کود NPK	1	روش تولید کود مرکب NPK با کیفیت بالا	# دستورالعمل تولید کود NPK\n\n## مواد اولیه مورد نیاز:\n- نیتروژن خالص: 20 کیلوگرم\n- فسفر پنتاکساید: 15 کیلوگرم  \n- پتاسیم کلراید: 10 کیلوگرم\n\n## مراحل تولید:\n1. آماده‌سازی مواد اولیه\n2. وزن‌کردن دقیق مواد\n3. مخلوط‌کردن در میکسر\n4. کنترل دما و رطوبت\n5. گرانول‌سازی\n6. خشک‌کردن\n7. بسته‌بندی\n\n## نکات ایمنی:\n- استفاده از ماسک و عینک ایمنی\n- تهویه مناسب محل کار\n- در صورت تماس با پوست، فوراً با آب شستشو دهید	2.1	approved	high	fa	\N	\N	\N	2025-06-14	2025-12-14	{تولید,کود,NPK,شیمیایی}	[]	public	0	\N	2025-06-14 14:20:47.765543	2025-06-14 15:02:34.260795
2	پروتکل ایمنی آزمایشگاه	2	دستورالعمل‌های ایمنی در آزمایشگاه شیمی	# پروتکل ایمنی آزمایشگاه\n\n## تجهیزات ایمنی الزامی:\n- عینک ایمنی\n- دستکش مقاوم به مواد شیمیایی\n- روپوش آزمایشگاه\n- کفش بسته\n\n## قوانین کلی:\n1. هرگز تنها در آزمایشگاه کار نکنید\n2. مواد شیمیایی را از روی برچسب شناسایی کنید\n3. در صورت بروز حادثه، فوراً به مسئول اطلاع دهید\n4. پس از کار، دست‌ها را کاملاً بشویید\n\n## اقدامات اضطراری:\n- تلفن آتش‌نشانی: 125\n- تلفن اورژانس: 115\n- دوش اضطراری: کنار درب ورودی	1.5	approved	critical	fa	\N	\N	\N	2025-06-14	2025-09-14	{ایمنی,آزمایشگاه,پروتکل}	[]	public	0	\N	2025-06-14 14:20:47.765543	2025-06-14 15:10:12.926647
